import React from "react";
import HighlightIcon from "@material-ui/icons/Highlight";

function Header() {
  return (
    <header>
       <img src="https://i.postimg.cc/KjVLqHbr/mkbhd-logo-4k-hd-wallpaper-thumb-removebg-preview.png" alt="" style={{width: "10%"}}/>
      <h1>
        MKBHD Keeper App
      </h1>
    </header>
  );
}

export default Header;
